import React from 'react'
import './Trade.css';
import TradingViewWidget from 'react-tradingview-widget';

export default function Trading() {

let symbol = 'BITSTAMP:BTCUSD'
let width = TradingViewWidget.width = '500px'
let heighty = TradingViewWidget.height = '500px'
let themey = TradingViewWidget.theme = 'Dark' ;
// let interval = TradingViewWidget.interval= "60" 
let indicators =  TradingViewWidget.studies = [ "Volume@tv-basicstudies",  "TripleEMA@tv-basicstudies",  "RSI@tv-basicstudies"]

console.log(Trading)
console.log(typeof Trading)
console.log(Trading.width)
console.log(indicators[0])

return (
<div className="Charts">



<TradingViewWidget

    symbol={symbol}
    theme={themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    style='8'
    interval='D'
    studies={indicators}  
    width={width}
    height={heighty}  
        // rangeTypes='ALL' 
      // autoSize='true'  
      // autoSize={true} 
/>

<TradingViewWidget
    symbol="BITSTAMP:BTCUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='W'
    studies={indicators}  

  />

<TradingViewWidget
    symbol="BITSTAMP:BTCUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='M'
    studies={indicators}          
  />


<TradingViewWidget

    symbol="BITSTAMP:BTCUSD"
    theme={themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    style='8'
    interval='3'
    studies={indicators}  
    width={width}
    height={heighty}  
        // rangeTypes='ALL' 
      // autoSize='true'   
/>

<TradingViewWidget
    symbol="BITSTAMP:BTCUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='15'
    studies={indicators}  

  />

<TradingViewWidget
    symbol="BITSTAMP:BTCUSD"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='45'
    studies={indicators}          
  />

</div>
)
}
